import NavBar from "./Components/NavBar";
import Title from "./Components/Title";
import './index.css'
import Category from "./Components/Category";

function App() {
  return (
    <div className="color-body">
      <NavBar/>
      <Container>
     <Title/>
     <Category/>

      </Container>
    </div>
  );
}

export default App;
